function calculatebaseBet(balance) {
    return balance / 1000;
}

var baseBet = calculatebaseBet(parseFloat(document.getElementById('pct_balance').value));
var base = baseBet;
var snowy = 0;
var previousBalance = Math.floor(parseFloat(document.getElementById('pct_balance').value) / (baseBet * 100)) * (baseBet * 100);
var great = parseFloat(document.getElementById('pct_balance').value);
var troll = false;
var beast = baseBet; // Initial bet amount
var seventy = (baseBet*69.9);
var eighty = (baseBet*79.9);
var balance = parseFloat(document.getElementById('pct_balance').value);
var boghart = (Math.floor(balance / (baseBet*10) )) * (baseBet*10) ;
var sevens = baseBet*6.9; 
var eights = baseBet*7.9; 

function start() {
    great = parseFloat(document.getElementById('pct_balance').value);
    balance = great;
    if ((great > ((Math.floor(great / (baseBet*10) )) * (baseBet*10) ) + (baseBet*6.9)) && (great < ((Math.floor(great / (baseBet * 10))) * (baseBet * 10)) + (baseBet*7.9)) && (great != snowy)) {    
        beast *= 2;
        snowy = parseFloat(great);
    }
    if ((balance<=(previousBalance+(3.4*baseBet)))&&(troll)&&(balance<(((Math.floor(balance / (baseBet*10)) ) * (baseBet*10))+(baseBet*6.9)))) {
        troll = false;
        baseBet = base;
        snowy = 0;
        beast = baseBet; 
        boghart = (Math.floor(balance / (baseBet * 10))) * (baseBet * 10);
        previousBalance = (Math.floor(balance /(baseBet*100) )) * (baseBet*100);
    }
    if ((balance<=(previousBalance-(69.9*base)))&&(balance<(((Math.floor(balance / (baseBet*10)) ) * (baseBet*10))+(baseBet*6.9)))) {
        troll = false;
        baseBet = base;
        snowy = 0;
        beast = baseBet; 
        boghart = (Math.floor(balance / (baseBet * 10))) * (baseBet * 10);
        previousBalance = (Math.floor(balance /(baseBet*100) )) * (baseBet*100);
    }  
    if ((balance >= (previousBalance+(baseBet*69.9)))&&(!troll)&&(balance<(((Math.floor(balance / (baseBet*10)) ) * (baseBet*10))+(baseBet*6.9)))) {
        baseBet = baseBet*10;
        beast = baseBet * 2;
        troll = true;
        snowy = parseFloat(great); 
        boghart = (Math.floor(balance / (baseBet * 10))) * (baseBet * 10);
        previousBalance = Math.floor(balance / (baseBet*10) ) * (baseBet*10) ;
    }
    if ((balance>(boghart+(baseBet*10)))&&(balance<(((Math.floor(balance / (baseBet*10)) ) * (baseBet*10))+(baseBet*6.9)))) {
        troll = false;
        baseBet = base;
        beast = baseBet;
        snowy = 0; 
        previousBalance = Math.floor(balance / (baseBet * 100)) * (baseBet * 100);
        boghart = (Math.floor(balance / (baseBet * 10))) * (baseBet * 10);
    }
if ((balance-(beast*20))<=0){
        troll = false;
        baseBet = base;
        beast = baseBet;
        snowy = 0; 
        previousBalance = Math.floor(balance / (baseBet * 100)) * (baseBet * 100);
        boghart = (Math.floor(balance / (baseBet * 10))) * (baseBet * 10);
    }
    $('#pct_chance').val(49.5); 
    $('#pct_bet').val(beast.toFixed(8)); // Ensure brackets are correctly placed
    document.body.firstChild.children[5].firstChild.lastChild.lastElementChild.lastChild.click();
    setTimeout(() => start(), 1); // Adjust timeout as needed
}


start();
